CREATE TABLE `banner` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pic` varchar(250) NOT NULL,
  `desc` varchar(150) NOT NULL,
  `link` varchar(150) NOT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1',
