INSERT INTO `engineer` VALUES (1,77,706,3953,'12345','唐马儒','asdqwe123','360481122812098978','/uploads/admin/20150827124534AW.jpg','15077778888','深圳观澜山水田园','http://docs.ebdoor.com/Image/CompanyCertificate/20/203464.jpg','/uploads/admin/20150827124936X4.jpg','十年从业经验，曾跟随名师学习推拿。2010年开始专攻少儿推拿，积累多年多年推拿经验。曾在福安堂担任首席推拿师。',1,'善于疏通经络，手法柔和，对肩颈腰酸背痛、头痛头晕、鼻炎，风湿性关节炎等有着丰富的调理手法和经验。','您的满意是我最大的追求！',1,1,0,'0000-00-00 00:00:00','2015-08-27 12:58:36'),(2,77,705,3952,'12345','刘奕丹','asdqwe123','232224198612213421','/uploads/admin/201508270101333L.jpg','13644445555','福田上沙伊妮村1134号','http://docs.ebdoor.com/Image/CompanyCertificate/20/203464.jpg','/uploads/admin/20150827010139Y1.jpg','6年从业敬经验，毕业于重庆中医学院，曾在永州市王氏推拿任职。圣诞节了发生将发牢骚说浪费讲述了福建省龙卷风送积分。哥拉斯加拉斯军绿色。撒的撒的精髓高速路过奖了。',0,'擅长辩证治疗各种头、颈、腰、急慢性疼痛。尤其是长时间伏案工作造成的慢性疼痛。','贴心服务，耐心询问，真心相对！',1,1,0,'0000-00-00 00:00:00','2015-08-27 13:05:00'),(3,77,705,3952,'12345','许成','asdqwe123','360481122812098978','/uploads/admin/20150827010914EH.jpg','17788889999','南山南头新豪方大厦','http://docs.ebdoor.com/Image/CompanyCertificate/20/203464.jpg','/uploads/admin/201508270109209N.jpg','5年工作经验，毕业于河南省洛阳市中医学院，曾在北京仙康中医保健馆担任推拿师。',1,'手法刚柔并重，对颈肩腰背疼痛、头痛头晕、鼻炎、内分泌失调等有着一套独特的调理手法。','你的信任是我最大的鼓励！',1,1,0,'0000-00-00 00:00:00','2015-08-27 13:13:53'),(6,77,706,3953,'','梁红',NULL,'13454558564678568','/uploads/admin/20150827011450HT.jpg','18978907822','建设二路梧桐花园',NULL,'/uploads/admin/201508270114581T.jpg','12年从业经验，汪苏泷的减肥拉萨解放路睡觉觉拉斯加拉斯军绿色罗杰斯的拉萨女蓝色将玩具数据V领数据速率军绿色叫哦我女军绿色了林俊杰我军好好哈干拉萨据了解速率丽江来说V毫无网络技术邻居欧文。圣诞节哦哦好文化馆。',0,'手法柔和细腻，有较强的渗透力，阿斯兰的卷发了送积分了撒。家里睡觉啦速率挪威。V辣酱俄罗斯女列举了计算机邻居欧文。来说V我问V文旅邻居。市净率将文件而V领我V领。睡觉了的精髓了解哈。军绿色局绿地。','服务要考实力，品质要考技能！',1,0,0,'0000-00-00 00:00:00','2015-08-27 13:16:55');

