INSERT INTO `health` VALUES (1,'红景天的功效与作用 抗缺氧抗疲劳','红景天的功效价值，红景天不含副作用，一款很受欢迎的药材，红景天含有很高的食疗价值，一般作为一种传统的中药来治疗疾病的，不过呢，红景天还是很不错的保健药材，能补肾，理气养血，有活血止血等功效呢。对男性补肾都具有好处的。','<p style=\";margin-bottom:0;line-height:30px\"><strong style=\"font-size: 36px;\"><span style=\"font-family: 宋体;\"><br/></span></strong></p><p style=\";margin-bottom:0;line-height:30px\"><strong style=\"font-size: 36px;\"><span style=\"font-family: 宋体;\">红景天的功效与作用 抗缺氧抗疲劳</span></strong></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 20px; color: rgb(0, 0, 0);\"><strong><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\"><br/></span></strong></span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 24px; color: rgb(0, 0, 0);\"><strong><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">1</span></strong><strong><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">、抗缺氧、抗疲劳</span></strong></span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 18px; color: rgb(0, 0, 0);\">红景天的功效与作用有哪些？能迅速提高血红蛋白与氧的结合能力，提高血氧饱和度，降低机体的耗氧量，增加运动耐力，恢复运动后疲劳。</span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 20px; color: rgb(0, 0, 0);\"><strong><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\"><br/></span></strong></span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 24px; color: rgb(0, 0, 0);\"><strong><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">2</span></strong><strong><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">、抗菌作用</span></strong></span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 18px; color: rgb(0, 0, 0);\">红景天内含有多量东莨菪碱、山萘酚等具有抗菌消炎成份;鞣质含量也最多，具收敛性，在粘膜表面起保护作用，制止过多的分泌、停止过量的出血，对肺部炎症引起的<span style=\"color: rgb(0, 0, 0); text-decoration: underline;\">咳嗽</span>、咳痰及妇女白带增多有疗效。</span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 18px; color: rgb(0, 0, 0);\"><strong><span style=\"font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体;\"><br/></span></strong></span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 24px;\"><span style=\"color: rgb(0, 0, 0);\"><strong><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">3</span></strong><strong><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">、抗氧</span></strong></span><span style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0); text-decoration: none; font-family: 宋体;\">化、抗糖尿病、抗肺炎及哮喘</span></strong></span></span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 18px; color: rgb(0, 0, 0);\">研究指出氧化作用在很多疾病的发展过程，扮演着十分重要的角色，例如癌症、<span style=\"font-size: 18px; color: rgb(0, 0, 0); text-decoration: underline;\">心血管</span>病、糖尿病、神经退化及类风湿性关节炎等。在传统医学中，红景天亦用于糖尿病治疗。临床表明，红景天可明显对抗肺炎及哮喘。对过敏性哮喘有效，一般成人视病情需要每日可用15---30克，水煎服，半月1疗程，可以依需要增加疗程。</span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 18px; color: rgb(0, 0, 0);\"><strong><span style=\"font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体;\"><br/></span></strong></span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 24px; color: rgb(0, 0, 0);\"><strong><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">4</span></strong><strong><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">、抗癌的功效</span></strong></span></p><p style=\";margin-bottom:0;line-height:30px\"><span style=\"font-size: 18px; color: rgb(0, 0, 0);\">红景天的功效与作用有哪些？一些报告指出红景天具有抗癌及抗突变的能力，它的抗癌机理在于细胞生长周期控制并使细胞凋亡。2006年一项研究指出红景天能抑制HL-60血癌细胞的分裂过程及减低它们的生存机会。另外，红景天可直接抑制<span style=\"font-size: 18px; color: rgb(0, 0, 0); text-decoration: underline;\">肺癌</span>细胞的生长及扩散。</span></p><p style=\"margin-bottom: 0px; line-height: 30px;\"><span style=\"font-size: 18px; color: rgb(0, 0, 0);\">目前，国内对红景天的研究还远远不及对人参、<span style=\"font-size: 18px; color: rgb(0, 0, 0); text-decoration: underline;\">刺五加</span>等那么透彻、深入，对其有效成分的研究，亦仅限于红景天苷及其苷元的研究。</span></p>',23,'朱柳慈','2015-08-12 09:37:00','2015-08-28 10:29:14',1),(2,'高脂血症患者的饮食禁忌是哪些','高脂血症由于脂肪代谢或运转异常使血浆一种或多种脂质高于正常称为高脂血症。高脂血症可表现为高胆固醇血症、高甘油三酯(三酰甘油)血症或两者兼有。高脂血症可分为原发性和继发性两类。原发性与先天性和遗传有关，是由于单基因缺陷或多基因缺陷，使参与脂蛋白转运和代谢的受体、酶或载脂蛋白异常所致，或由于环境因素（饮食、营养、药物）和通过未知的机制而致。','<p style=\"margin-bottom: 0px; line-height: 1.5em;\"><span style=\"font-size: 20px; color: rgb(68, 68, 68);\">【前面的话】高脂血症由于脂肪代谢或运转异常使血浆一种或多种脂质高于正常称为高脂血症。高脂血症可表现为高胆固醇血症、高甘油三酯(三酰甘油)血症或两者兼有。高脂血症可分为原发性和继发性两类。原发性与先天性和遗传有关，是由于单基因缺陷或多基因缺陷，使参与脂蛋白转运和代谢的受体、酶或载脂蛋白异常所致，或由于环境因素（饮食、营养、药物）和通过未知的机制而致。</span></p><p style=\"margin-bottom: 0px; line-height: 1.5em;\"><span style=\"font-size: 20px; color: rgb(68, 68, 68);\">胆固醇含量高的食物蛋黄、猪脑、猪肝、皮蛋、鳗鱼、蟹黄、猪腰子、鱼子、对虾、奶油、蛋类、鱼肝油等含胆固醇高的食物，平时应忌吃或少吃。</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px; color: rgb(227, 108, 9);\"></span></p><p style=\"margin-bottom: 0px; line-height: 1.5em;\"><span style=\"font-size: 24px;\"><strong><span style=\"font-family: 宋体; color: rgb(68, 68, 68);\"><br/></span></strong></span></p><p style=\"margin-bottom: 0px; line-height: 1.5em;\"><span style=\"font-size: 24px;\"><strong><span style=\"font-family: 宋体; color: rgb(68, 68, 68);\">甜食</span></strong></span></p><p style=\"margin-bottom: 0px; line-height: 1.5em;\"><span style=\"font-size: 20px; color: rgb(227, 108, 9); text-decoration: none;\">糖类食物如蔗糖、果糖，对甘油三酯(三酰甘油)的含量有一定的影响。有人在饲养动物时，用蔗糖代替淀粉，可使动物的血胆固醇和甘油三酯(三酰甘油)均增高。在某些脂肪摄人量较高的国家和地区．当糖用量增加时，冠心病的发病率也增</span><span style=\"font-size: 20px; color: rgb(227, 108, 9);\">高。</span></p><p style=\"margin-bottom: 0px; line-height: 1.5em;\"><span style=\"font-size: 24px;\"><strong><span style=\"font-size: 14px; font-family: 宋体; color: rgb(68, 68, 68);\"><br/></span></strong></span></p><p style=\"margin-bottom: 0px; line-height: 1.5em;\"><span style=\"font-size: 24px;\"><strong><span style=\"font-family: 宋体; color: rgb(68, 68, 68);\">酒</span></strong></span></p><p style=\"margin-bottom: 0px; line-height: 1.5em;\"><span style=\"font-size: 24px; color: rgb(227, 108, 9);\">长期饮酒者也可诱发血脂升高，心肌中脂肪增加，心脏功能会减弱，心脏肥大。特别是长期大量饮啤酒的人，心脏更容易出现这种变化，医学上称“啤酒心”。</span></p><p style=\"margin-bottom: 0px; line-height: 1.5em;\"><span style=\"font-size: 24px; text-decoration: none;\"><strong><span style=\"text-decoration: none; font-family: 宋体; color: rgb(68, 68, 68);\"><br/></span></strong></span></p><p style=\"margin-bottom: 0px; line-height: 1.5em;\"><span style=\"font-size: 24px; text-decoration: none;\"><strong><span style=\"text-decoration: none; font-family: 宋体; color: rgb(68, 68, 68);\">咖啡</span></strong></span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px; text-decoration: none; color: rgb(227, 108, 9);\"><span style=\"font-size: 20px; text-decoration: none; font-family: 宋体;\">过多饮用咖啡会使血清胆固醇增高，从而加霞病情，对已患有高血压、冠心病和动脉硬化的人危险性更大，据研究，一天喝</span><span style=\"font-size: 20px; text-decoration: none; font-family: Calibri, sans-serif;\">1</span><span style=\"font-size: 20px; text-decoration: none; font-family: 宋体;\">—</span><span style=\"font-size: 20px; text-decoration: none; font-family: Calibri, sans-serif;\">4</span><span style=\"font-size: 20px; text-decoration: none; font-family: 宋体;\">杯咖啡的人，血中胆固醇的浓度比不喝咖啡的人高</span><span style=\"font-size: 20px; text-decoration: none; font-family: Calibri, sans-serif;\">5</span><span style=\"font-size: 20px; text-decoration: none; font-family: 宋体;\">％，喝上</span><span style=\"font-size: 20px; text-decoration: none; font-family: Calibri, sans-serif;\">9</span><span style=\"font-size: 20px; text-decoration: none; font-family: 宋体;\">杯，则高</span><span style=\"font-size: 20px; text-decoration: none; font-family: Calibri, sans-serif;\">ll</span><span style=\"font-size: 20px; text-decoration: none; font-family: 宋体;\">％，故忌多饮之。</span></span></p>',41,'宏远','2015-08-12 09:38:00','2015-08-28 10:36:09',1),(3,'小孩迟迟不肯睡 辨别体质来照顾','有时候小孩很困，嚷嚷着要睡觉，但是由于外部环境比较复杂，比如家里来客人了，客厅难免人杂，即使保持相对安静，也会对小孩产生不好的影响，小孩会形成一种类似于还生活在白天的感觉，这些对小孩的睡眠是有影响的。','<p style=\"line-height: 1.5em;\"><span style=\"font-size: 24px;\"><strong>小孩要入睡 环境须配合</strong></span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px;\">有时候小孩很困，嚷嚷着要睡觉，但是由于外部环境比较复杂，比如家里来客人了，客厅难免人杂，即使保持相对安静，也会对小孩产生不好的影响，小孩会形成一种类似于还生活在白天的感觉，这些对小孩的睡眠是有影响的。</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px;\">“小孩子的睡眠质量是要十分细心照顾的，定好晚上10点睡觉就不要推迟时间，这对小孩的习惯形成会造成不良的影响。睡觉前的外部环境可以适当缓和下来，比如10点睡觉，那么之前可以把客厅的灯光慢慢调暗一些，也不要给孩子看比较激烈的动画或者电视。家长在孩子睡觉前也要适当保持安静的情绪，不要选择看球或者比较喧哗的活动，影响到小孩的情绪。”胡小英教授说。</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px;\"><br/></span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 24px;\"><strong>辨别体质调睡眠</strong></span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px;\">胡小英教授表示，中医在调理小孩的睡眠情况时会根据具体的辨证来调理的，临床上很多夜不能入睡的小孩通过中医的调理以及相关的家长指导配合就能慢慢好起来。中医认为一般的小儿夜寐欠佳、好动不安，常是由于心肝火旺引起了，此时饮食应注意清淡，食疗应使用清肝养心之品，家长平时对这种小孩也要耐心，避免小孩养成躁动的不良习惯。</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px;\"><br/></span></p><p style=\"line-height: 1.5em;\"><strong><span style=\"font-size: 24px;\">肝火旺</span></strong></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px;\">这种小孩容易发脾气，或者莫名发怒，中医上多会采用清肝火的治疗方法，常用到白芍、郁金、独角金等煮水，一般用量多在10克，当然用量要根据小孩的情况来使效果更佳。</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px;\"><br/></span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 24px;\"><strong>心火旺</strong></span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px;\">容易烦躁、精神不集中，舌尖发红、小便发黄，中医多会采用清心火的灯心草、通草、淡竹叶等来清心除烦，如果出现大便干燥的情况，则可以适当添加生地清热生津。</span></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px;\"><br/></span></p><p style=\"line-height: 1.5em;\"><strong><span style=\"font-size: 24px;\">虚证</span></strong></p><p style=\"line-height: 1.5em;\"><span style=\"font-size: 20px;\"><span style=\"font-size: 24px;\"></span>有些小孩虽然很容易就出现疲倦但迟迟不肯入睡，如果伴有脸色较白、容易怕事的表现，那么在治疗上就会采用太子参、麦冬、酸枣仁等来调心补益，对这些小孩要多加鼓励，引导小孩做一些平时不敢接触的活动，让小孩能把“心”放开。</span></p><p><br/></p>',38,'腾讯新闻','2015-08-27 18:44:22','2015-08-28 10:46:54',1);

#
# Structure for table "manager"
#

DROP TABLE IF EXISTS `manager`;
CREATE TABLE `manager` (
  `id` int(8) NOT NULL AUTO_INCREMENT COMMENT '管理员ID',
  `name` varchar(32) DEFAULT NULL COMMENT '管理员昵称',
  `phoneNo` varchar(32) DEFAULT NULL COMMENT '管理员手机号码',
  `mail` varchar(64) DEFAULT NULL COMMENT '管理员邮箱',
  `password` varchar(32) DEFAULT NULL COMMENT '管理员密码 md5',
  `role` int(8) DEFAULT NULL COMMENT '管理员权限',
  `utime` datetime DEFAULT NULL COMMENT '修改时间',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态',
  `ctime` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

