#
# Structure for table "member"
#

DROP TABLE IF EXISTS `member`;
CREATE TABLE `member` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '会员类型，1:平台正式会员;2:店铺线下会员，购买了会员卡但还未激活成平台会员',
  `store_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '店铺id.所属该店铺的会员',
  `tel` varchar(20) NOT NULL COMMENT '手机号',
  `nick` varchar(30) NOT NULL DEFAULT '' COMMENT '昵称',
  `trueName` varchar(20) DEFAULT NULL COMMENT '真实姓名',
  `gender` tinyint(1) NOT NULL DEFAULT '1' COMMENT '性别：1,男；2,女',
  `address` varchar(100) DEFAULT '' COMMENT '地址',
  `pwd` char(30) NOT NULL DEFAULT '' COMMENT '密码',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `ctime` datetime NOT NULL COMMENT '创建时间',
  `utime` datetime DEFAULT NULL COMMENT '修改时间',
  `avatar` varchar(250) DEFAULT '' COMMENT '头像',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：1,启用；0,禁用',
  PRIMARY KEY (`id`),
  UNIQUE KEY `tel` (`tel`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='用户表';

