#
# Structure for table "order_copy"
#

DROP TABLE IF EXISTS `order_copy`;
CREATE TABLE `order_copy` (
  `id` int(8) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(8) NOT NULL COMMENT '会员iD',
  `sid` int(8) NOT NULL COMMENT '对象ID',
  `nums` tinyint(4) unsigned NOT NULL COMMENT '预约人数',
  `type` tinyint(4) unsigned NOT NULL COMMENT '消费类型:1.店铺。2.技师',
  `provider` varchar(50) DEFAULT NULL COMMENT '提供者店铺或技师名',
  `serviceId` int(8) NOT NULL DEFAULT '0' COMMENT '服务id',
  `orderNo` varchar(16) NOT NULL COMMENT '订单编号 日期+id',
  `price` float NOT NULL COMMENT '售价',
  `amount` float(8,2) NOT NULL COMMENT '实付金额',
  `payType` tinyint(4) DEFAULT NULL COMMENT '1微信 2支付宝 3银联 4预付卡 5现金',
  `payStatus` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1未付款 2已付款 3已退款',
  `orderStatus` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1已下单 2取消  21付款确认中  3待服务，已审核 31取消中，待审核  4已退款  41退款中 42退款失败5已服务,待评价6已评价',
  `ctime` datetime DEFAULT NULL COMMENT '订单生成时间',
  `serviceTime` datetime DEFAULT NULL COMMENT '预约服务时间',
  `payTime` datetime DEFAULT NULL COMMENT '支付时间',
  `finishTime` datetime DEFAULT NULL COMMENT '订单完成时间',
  `ucid` varchar(16) DEFAULT NULL COMMENT '优惠卷id',
  `isVisit` enum('0','1') NOT NULL DEFAULT '1' COMMENT '是否上门',
  `address` varchar(150) DEFAULT NULL COMMENT '服务地址',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `chargeId` varchar(100) DEFAULT NULL COMMENT '支付的charge_id',
  `consignee` varchar(30) DEFAULT NULL COMMENT '收货人，下单人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='订单表';

