#
# Structure for table "reback"
#

DROP TABLE IF EXISTS `reback`;
CREATE TABLE `reback` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned DEFAULT '0' COMMENT '订单id',
  `user_id` int(10) unsigned DEFAULT '0' COMMENT '申请用户id',
  `store_id` int(10) unsigned DEFAULT '0' COMMENT '店铺id',
  `ctime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '申请时间',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态 0初始状态(用户申请退款)1商家确认11商家拒绝退款2平台拒绝3已打款',
  `amount` float DEFAULT '0' COMMENT '退款金额',
  `payType` tinyint(4) DEFAULT '0' COMMENT '退还方式',
  `account` varchar(50) DEFAULT '0' COMMENT '退还账户账号',
  `utime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  `remark` varchar(250) NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '备注',
  `checkUserName` varchar(20) NOT NULL DEFAULT '' COMMENT '审核人',
  `refuseReason` varchar(120) NOT NULL DEFAULT '' COMMENT '拒绝理由',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_id` (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='退款';

