INSERT INTO `store_detail` VALUES (1,1,'a:1:{i:77;a:2:{i:707;a:1:{i:0;s:4:\"3954\";}i:705;a:1:{i:0;s:4:\"3952\";}}}','<p>•饭后30分钟内不宜推拿</p><p>•女性月经期间不宜推拿</p><p>•怀孕者腰部腹部不宜进行推拿，服务前请告知推拿师</p><p>•过度饥饿血糖过低需要及时补充能量</p><p>•酒醉后要休息清醒后再接受推拿理疗</p><p>•房间温度过低应先打开暖气或空调后再接受推拿理疗</p><p>•剧烈运动过度疲劳应先要休息片刻后再接受推拿理疗</p><p>•女推拿师不携带折叠推拿床上门服务</p><p>•女推拿师不上门服务男客户</p>','<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>订单服务时间开始前2小时以上修改/取消订单，不收取任何违约金；</p></li><li><p>订单服务时间开始前2小时内修改/取消订单，扣除30元的违约金；</p></li><li><p>订单服务时间后修改/取消订单，扣除60元的违约金。<br/></p></li></ol>','a:2:{s:7:\"timeArr\";a:16:{i:0;s:1:\"1\";i:1;s:1:\"1\";i:2;s:1:\"0\";i:3;s:1:\"1\";i:4;s:1:\"0\";i:5;s:1:\"0\";i:6;s:1:\"1\";i:7;s:1:\"1\";i:8;s:1:\"1\";i:9;s:1:\"1\";i:10;s:1:\"1\";i:11;s:1:\"1\";i:12;s:1:\"1\";i:13;s:1:\"1\";i:14;s:1:\"1\";i:15;s:1:\"0\";}s:4:\"nums\";s:1:\"6\";}',1000,'6230580010029018864','曹文鹏','2015-11-24 17:11:00'),(2,2,'','<p>•饭后30分钟内不宜推拿</p><p>•女性月经期间不宜推拿</p><p>•怀孕者腰部腹部不宜进行推拿，服务前请告知推拿师</p><p>•过度饥饿血糖过低需要及时补充能量</p><p>•酒醉后要休息清醒后再接受推拿理疗</p><p>•房间温度过低应先打开暖气或空调后再接受推拿理疗</p><p>•剧烈运动过度疲劳应先要休息片刻后再接受推拿理疗</p><p>•女推拿师不携带折叠推拿床上门服务</p><p>•女推拿师不上门服务男客户</p>','<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>订单服务时间开始前2小时以上修改/取消订单，不收取任何违约金；</p></li><li><p>订单服务时间开始前2小时内修改/取消订单，扣除30元的违约金；</p></li><li><p>订单服务时间后修改/取消订单，扣除60元的违约金。<br/></p></li></ol>','a:2:{s:7:\"timeArr\";a:16:{i:0;i:1;i:1;i:1;i:2;i:1;i:3;i:1;i:4;i:1;i:5;i:1;i:6;i:1;i:7;i:1;i:8;i:1;i:9;i:1;i:10;i:1;i:11;i:1;i:12;i:1;i:13;i:1;i:14;i:1;i:15;i:1;}s:4:\"nums\";i:5;}',0,'0','0',NULL),(3,3,'','<p>•饭后30分钟内不宜推拿</p><p>•女性月经期间不宜推拿</p><p>•怀孕者腰部腹部不宜进行推拿，服务前请告知推拿师</p><p>•过度饥饿血糖过低需要及时补充能量</p><p>•酒醉后要休息清醒后再接受推拿理疗</p><p>•房间温度过低应先打开暖气或空调后再接受推拿理疗</p><p>•剧烈运动过度疲劳应先要休息片刻后再接受推拿理疗</p><p>•女推拿师不携带折叠推拿床上门服务</p><p>•女推拿师不上门服务男客户</p>','<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>订单服务时间开始前2小时以上修改/取消订单，不收取任何违约金；</p></li><li><p>订单服务时间开始前2小时内修改/取消订单，扣除30元的违约金；</p></li><li><p>订单服务时间后修改/取消订单，扣除60元的违约金。<br/></p></li></ol>