INSERT INTO `store_service` VALUES (1,1,'防感冒推拿',134.00,'全身推拿着重于人体全身的十四条经络，由头至足全面展开操作，遵循中医学整体观念，有效改善人体亚健康症状，并能化解身体内在颗粒、条索、块状等淤堵现象，对人体展全面的经络疏通，从而起到促进气血温养、经络疏通、筋骨理顺的作用功效，从总体上调整机体功能、增强抗病能力。','\r\n\r\n    推拿可以帮您放松身体、但在不适宜的情况下进行推拿，可能使问题加重甚至恶化。以下这些情况下，禁忌使用推拿服务：\r\n\r\n    •高烧发热\r\n\r\n    •严重心脏病\r\n\r\n    •骨折、骨质疏松\r\n\r\n    •严重皮肤感染或大面积皮肤破损\r\n\r\n    •心脑血管病发病期\r\n\r\n    •急性传染病（如肝炎或肺结核）\r\n\r\n    •有出血倾向（如血小板减少者、恶性贫血、白血病）\r\n\r\n    •大病初愈或大手术伤口处于恢复\r\n\r\n    •精神病情绪不稳定\r\n\r\n    •疼痛但诊断不明确\r\n\r\n    •恶性肿瘤和艾滋病\r\n\r\n','2015-11-26 16:29:57',45,'a:3:{i:0;a:2:{s:8:\"cargo_id\";s:1:\"1\";s:4:\"nums\";s:1:\"1\";}i:1;a:2:{s:8:\"cargo_id\";s:1:\"2\";s:4:\"nums\";s:1:\"1\";}i:2;a:2:{s:8:\"cargo_id\";s:1:\"3\";s:4:\"nums\";s:1:\"1\";}}',1,'/uploads/admin/20151126042734RY.jpg','2015-12-04 16:48:09',1),(2,1,' 拿拿一身推',90.00,'由头至足全面展开操作，遵循中医学整体观念，有效改善人体亚健康症状，并能化解身体内在颗粒、条索、块状等淤堵现象。头面颈肩推拿运用点按、拿捏、弹拨、击拍、揉摩等传统推拿手法疏通头部、颈项经络，有效促进脑部供血，减轻大脑负担。\r\n\r\n','\r\n    推拿可以帮您放松身体、但在不适宜的情况下进行推拿，可能使问题加重甚至恶化。以下这些情况下，禁忌使用推拿服务：\r\n\r\n    •高烧发热\r\n\r\n    •严重心脏病\r\n\r\n    •骨折、骨质疏松\r\n\r\n    •严重皮肤感染或大面积皮肤破损\r\n\r\n    •心脑血管病发病期\r\n\r\n    •急性传染病（如肝炎或肺结核）\r\n\r\n    •有出血倾向（如血小板减少者、恶性贫血、白血病）\r\n\r\n    •大病初愈或大手术伤口处于恢复\r\n\r\n    •精神病情绪不稳定\r\n\r\n','2015-11-26 18:43:34',40,'a:3:{i:0;a:2:{s:8:\"cargo_id\";s:1:\"1\";s:4:\"nums\";s:1:\"1\";}i:1;a:2:{s:8:\"cargo_id\";s:1:\"2\";s:4:\"nums\";s:1:\"2\";}i:2;a:2:{s:8:\"cargo_id\";s:1:\"3\";s:4:\"nums\";s:1:\"1\";}}',1,'/uploads/admin/2015112606433031.jpg','2015-12-04 16:48:41',1),(3,1,' 轻松头面肩 ',168.00,'中医经络学认为头为诸阳之会，头部经络通则精神气色佳，头面颈肩推拿运用点按、拿捏、弹拨、击拍、揉摩等传统推拿手法疏通头部、颈项经络，有效促进脑部供血，减轻大脑负担，缓解视力疲劳、头晕目眩等症状，大大提高人体免疫力，补充元气能量。','\r\n\r\n    推拿可以帮您放松身体、但在不适宜的情况下进行推拿，可能使问题加重甚至恶化。以下这些情况下，禁忌使用推拿服务：\r\n\r\n    •高烧发热\r\n\r\n    •严重心脏病\r\n\r\n    •骨折、骨质疏松\r\n\r\n    •严重皮肤感染或大面积皮肤破损\r\n\r\n    •心脑血管病发病期\r\n\r\n    •急性传染病（如肝炎或肺结核）\r\n\r\n    •有出血倾向（如血小板减少者、恶性贫血、白血病）\r\n\r\n    •大病初愈或大手术伤口处于恢复\r\n\r\n    •精神病情绪不稳定\r\n\r\n    •疼痛但诊断不明确\r\n\r\n    •恶性肿瘤和艾滋病\r\n','2015-11-26 18:49:19',60,'a:3:{i:0;a:2:{s:8:\"cargo_id\";s:1:\"1\";s:4:\"nums\";s:1:\"1\";}i:1;a:2:{s:8:\"cargo_id\";s:1:\"2\";s:4:\"nums\";s:1:\"1\";}i:2;a:2:{s:8:\"cargo_id\";s:1:\"3\";s:4:\"nums\";s:1:\"1\";}}',1,'/uploads/admin/20151126064846U0.jpg','2015-12-03 11:13:57',1),(4,3,'中医推拿',150.00,'中医推拿着重于人体全身的十四条经络，由头至足全面展开操作，遵循中医学整体观念，有效改善人体亚健康症状，并能化解身体内在颗粒、条索、块状等淤堵现象，对人体展全面的经络疏通，从而起到促进气血温养、经络疏通、筋骨理顺的作用功效，从总体上调整机体功能、增强抗病能力。','•饭后30分钟内不宜推拿\r\n\r\n•女性月经期间不宜推拿\r\n\r\n•怀孕者腰部腹部不宜进行推拿，服务前请告知推拿师\r\n\r\n•过度饥饿血糖过低需要及时补充能量\r\n\r\n•酒醉后要休息清醒后再接受推拿理疗\r\n\r\n•房间温度过低应先打开暖气或空调后再接受推拿理疗','2015-11-27 16:08:32',45,NULL,1,'/uploads/admin/20151127040553MA.jpg','2015-11-27 16:08:32',1),(5,3,'放血疗法',100.00,'中医的放血疗法是以针刺某些穴位或体表小静脉而放出少量血液的治疗方法。','针刺入一般不宜过深\r\n操作时，先行皮肤常规消毒。','2015-11-27 16:10:37',40,NULL,1,'/uploads/admin/20151127044608RP.jpg','2015-11-27 16:46:58',1),(6,1,'测试',80.00,'<p>dddddddddddddddddddddddddddddd的法国那边</p><p><br/></p>','<p><strong>ds</strong>fgfgfgf</p><p>dddddddd<br/></p><p><br/></p>','2015-12-01 15:16:16',40,'a:3:{i:0;a:2:{s:8:\"cargo_id\";s:1:\"1\";s:4:\"nums\";s:1:\"0\";}i:1;a:2:{s:8:\"cargo_id\";s:1:\"2\";s:4:\"nums\";s:1:\"0\";}i:2;a:2:{s:8:\"cargo_id\";s:1:\"3\";s:4:\"nums\";s:1:\"0\";}}',1,'/uploads/admin/20151201031550PH.jpg','2015-12-04 17:02:53',1);

